import { useState } from 'react';
import ProductList from '../components/ProductList';

const Home = () => {
  const [products] = useState([
    { id: 1, name: "Camiseta Branca", price: 49.90, image: "https://via.placeholder.com/200?text=Camiseta+Branca" },
    { id: 2, name: "Calça Jeans", price: 129.90, image: "https://via.placeholder.com/200?text=Calça+Jeans" },
    { id: 3, name: "Tênis Esportivo", price: 199.90, image: "https://via.placeholder.com/200?text=Tênis+Esportivo" },
    { id: 4, name: "Relógio Digital", price: 89.90, image: "https://via.placeholder.com/200?text=Relógio+Digital" },
    { id: 5, name: "Mochila", price: 79.90, image: "https://via.placeholder.com/200?text=Mochila" },
    { id: 6, name: "Óculos de Sol", price: 59.90, image: "https://via.placeholder.com/200?text=Óculos+de+Sol" }
  ]);

  return (
    <div className="home-page">
      <h1>Produtos</h1>
      <ProductList products={products} />
    </div>
  );
};

export default Home;
